import React from "react";
import { Nav } from "react-bootstrap";

const MainHeader = () => {
  return (
    <Nav
      className="navbar navbar-light justify-content-center"
      style={{
        backgroundColor: "#e3f2fd",
      }}
    >
      <h1>Expense Mangement System</h1>
    </Nav>
  );
};

export default MainHeader;
